import React from 'react';
import styled from 'styled-components';
import ArrowCircleRightOutlinedIcon from '@mui/icons-material/ArrowCircleRightOutlined';
import ArrowCircleLeftOutlinedIcon from '@mui/icons-material/ArrowCircleLeftOutlined';
import { style } from '@mui/system';
import data from '../src/data.js';

const Container = styled.div`
    width:100vw;
    height:100vh;

    position:relative;
    overflow: hidden;
    display:flex;

`
const Arrow = styled.div`
    width:50px;
    height:50px;
    background-color: #f4aa75;
    border-radius: 50%;
    display:flex;
    align-items: center;
    justify-content: center;
    color:maroon;
    position:absolute;
    left:${props => props.direction === 'left' && '10px'};
    right:${props => props.direction === 'right' && '10px'};
    top:0;
    bottom:0;
    margin :auto;
    cursor: pointer;
    opacity:0.5;
    z-index:1;
`

const Wrapper = styled.div`

    display:flex;

    flex-direction: row;
    transform:translateX(0vw);

`
const Slide = styled.div`
 display:flex;
 align-items: center;
 width: 100vw;
 height: 100vh; 
 background-color: #${props=>props.bg};
`
const Imgcontainer = styled.div`
flex:1;  
height: 100%;



`
const Image = styled.img`
height: 80%;
`

const Infocontainer = styled.div`
padding: 40px;  
flex:1; 



`
const Title = styled.h1`
  font-size  :70px ;
`
const Description = styled.p`

    margin:50px,0px;
    font-size: 20px;
    font-weight: 500;
    letter-spacing: 1.5px;
`
const Button = styled.button`
  padding  :10px ;
  margin-top: 20px;
  font-size: 15px;
  background-color: transparent;
  cursor:pointer;
  border-radius: 6px;
`




function Slider() {
    return (
        <Container>
            <Arrow direction='left'>
                <ArrowCircleLeftOutlinedIcon />
            </Arrow>

            <Wrapper>
                <Slide bg="f5fafd">
                    <Imgcontainer>
                        <Image src="https://images.pexels.com/photos/2043590/pexels-photo-2043590.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" />
                    </Imgcontainer>
                    <Infocontainer>
                        <Title>
                            SUMMER SALE
                        </Title>
                        <Description >

                        </Description>
                        <Button>
                            SHOP NOW
                        </Button>
                    </Infocontainer>
                </Slide>

                <Slide bg="fcf1ed">
                    <Imgcontainer>
                        <Image src="https://images.pexels.com/photos/2043590/pexels-photo-2043590.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" />
                    </Imgcontainer>
                    <Infocontainer>
                        <Title>
                            SUMMER SALE
                        </Title>
                        <Description >
                            DON'T COMPROMISE ON STYLE!! SUMMER SALE...FLAT 40%OFF!!
                        </Description>
                        <Button>
                            SHOP NOW
                        </Button>
                    </Infocontainer>
                </Slide>

                <Slide bg="fbf0f4">
                    <Imgcontainer>
                        <Image src="https://images.pexels.com/photos/2043590/pexels-photo-2043590.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" />
                    </Imgcontainer>
                    <Infocontainer>
                        <Title>
                            SUMMER SALE
                        </Title>
                        <Description >
                            DON'T COMPROMISE ON STYLE!! SUMMER SALE...FLAT 40%OFF!!
                        </Description>
                        <Button>
                            SHOP NOW
                        </Button>
                    </Infocontainer>
                </Slide>



            </Wrapper>
            <Arrow direction='right'>
                <ArrowCircleRightOutlinedIcon />
            </Arrow>

        </Container>
    )
}
export default Slider;
